import React from 'react';

function We() {
  return (
    <div className="wrapper we">
      <h2 className="we__title second__title">Кто мы</h2>
      <div className="we__img">
        <img src="img/we.png" alt="" />
      </div>
      <div className="we__descr">
        <p className="strong__text">Венчурная студия ProfitLab —</p>
        <p className="we__descr--main">
          компания, которая даёт возможности для роста и развития стартапов,
          разрабатывает и обеспечивает их целым рядом сервисов и необходимых ресурсов
        </p>
      </div>
    </div>
  );
}

export default We;
